
import numpy as np


def add_int64(num1: np.int64, num2: np.int64) -> np.int64:
    return num1 + num2


def add_double(num1: np.double, num2: np.double) -> np.double:
    return num1 + num2


def subtract_int64(num1: np.int64, num2: np.int64) -> np.int64:
    return num1 - num2


def subtract_double(num1: np.double, num2: np.double) -> np.double:
    return num1 - num2


def multiply_int64(num1: np.int64, num2: np.int64) -> np.int64:
    return num1 * num2


def multiply_double(num1: np.double, num2: np.double) -> np.double:
    return num1 * num2
